  --gun-powder: #44385d66;
  --mirage: #191e23;
  --peach-cream: #fff1de;
  --pink-swan: #b8b8b8;
  --rodeo-dust: #cab99b;
  --steel-gray: #282138;
  --sunshade: #ffaa2c;
  --tawny-port: #5a274666;
  --white: #ffffff;
  --white-2: #ffffff33;
  --woody-brown: #462b3f66;

  --font-size-l: 16px;
